import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
const e = React.createElement;
function App() {
  return (
    e('div',{className:'container main'},
      e('div',{className:'row'},
        e('div',{className:'col-md-6'},'hi1'),
        e('div',{className:'col-md-6'},'hi2')
      )
    )
  );
}

export default App;
